import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"REASSIGN OWNED","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/REASSIGN_OWNED.md","filePath":"docs/7x/ref_guide/sql_commands/REASSIGN_OWNED.md"}'),i={name:"docs/7x/ref_guide/sql_commands/REASSIGN_OWNED.md"};function n(l,e,d,r,c,h){return o(),t("div",null,e[0]||(e[0]=[s(`<h1 id="reassign-owned" tabindex="-1">REASSIGN OWNED <a class="header-anchor" href="#reassign-owned" aria-label="Permalink to &quot;REASSIGN OWNED&quot;">​</a></h1><p>Changes the ownership of database objects owned by a database role.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>REASSIGN OWNED BY { &lt;old_role&gt; | CURRENT_USER | SESSION_USER } [, ...]</span></span>
<span class="line"><span>               TO { &lt;new_role&gt; | CURRENT_USER | SESSION_USER }</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>REASSIGN OWNED</code> changes the ownership of database objects owned by any of the old_roles to new_role.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>old_role : The name of a role. The ownership of all the objects in the current database, and of all shared objects (databases, tablespaces), owned by this role will be reassigned to new_role.</p><p>new_role : The name of the role that will be made the new owner of the affected objects.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p><code>REASSIGN OWNED</code> is often used to prepare for the removal of one or more roles. Because <code>REASSIGN OWNED</code> does not affect objects in other databases, it is usually necessary to run this command in each database that contains objects owned by a role that is to be removed.</p><p><code>REASSIGN OWNED</code> requires privileges on both the source role(s) and the target role.</p><p>The <a href="./DROP_OWNED.html">DROP OWNED</a> command is an alternative that simply drops all of the database objects owned by one or more roles.</p><p>The <code>REASSIGN OWNED</code> command does not affect any privileges granted to the old_roles on objects that are not owned by them. Likewise, it does not affect default privileges created with <code>ALTER DEFAULT PRIVILEGES</code>. Use <code>DROP OWNED</code> to revoke such privileges.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Reassign any database objects owned by the role named <code>sally</code> and <code>bob</code> to <code>admin</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>REASSIGN OWNED BY sally, bob TO admin;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The <code>REASSIGN OWNED</code> command is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./DROP_OWNED.html">DROP OWNED</a>, <a href="./DROP_ROLE.html">DROP ROLE</a>, <a href="./ALTER_DATABASE.html">ALTER DATABASE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,22)]))}const b=a(i,[["render",n]]);export{m as __pageData,b as default};
